	public ActionForward execute(ActionMapping mapping, ActionForm form, HttpServletRequest request, HttpServletResponse response)throws IOException, ServletException 
	{
		String target = "success";
		
		
		//TestanswerForm taf = (TestanswerForm)form;
		//String strTestTyp = (request.getParameter("testtyp")!=null) ? request.getParameter("testtyp").trim() : "Digital";
		try
		{
			HttpSession session = request.getSession();
			Vector testData = (session.getAttribute("TestData")!=null) ? (Vector)session.getAttribute("TestData") : new Vector();
			String strTestTyp = (session.getAttribute("TestData")!=null) ? testData.elementAt(testData.size()-3).toString().trim() : "Digital";
			String strTid = (session.getAttribute("testid") != null) ? (String)session.getAttribute("testid") : "0";
			String strTyp = (session.getAttribute("reqtyp") != null) ? (String)session.getAttribute("reqtyp") : "New";
			////////System.out.println("Test Data in Ans Data "+testData);
			////////System.out.println("Test ID in Ans Data "+strTid);
			////////System.out.println("Request Type in Ans Data "+strTyp);
			
			//session.setAttribute("TestData", testData);
			//session.setAttribute("testid", strTid);
			//session.setAttribute("reqtyp", strTyp);
			if(strTyp.equalsIgnoreCase("New"))
			{
				////////System.out.println("In New");
				form = buildUserForm(strTestTyp);
			}
			else
			{
				
				if(Integer.parseInt(strTid.trim())<=0)
				{
					////////System.out.println("In Tid 0");
					form = buildUserForm(strTestTyp);
				}
				else
				{
					//////System.out.println("In Edit");
					form = buildUserEditForm(Integer.parseInt(strTid.trim()), request, strTestTyp);
				}
			}
			if("request".equals(mapping.getScope()) ) 
			{
				request.setAttribute(mapping.getAttribute(), form);
		    }
		    else 
		    {
	        	session.setAttribute(mapping.getAttribute(), form);
		    }
		}
		catch(Exception e)
		{
			e.printStackTrace();
			target = new String("failure");
		    ActionErrors errors = new ActionErrors();

		      errors.add(ActionErrors.GLOBAL_ERROR,
		        new ActionError("errors.database.error", e.getMessage()));

		      // Report any errors
		      if ( !errors.isEmpty() ) {

		        saveErrors(request, errors);
		      }
		}
		return (mapping.findForward(target));
	}
